import React, { useState } from 'react';
import ReactFlow, { MiniMap, Controls, Background, useNodesState, useEdgesState } from 'reactflow';
import 'reactflow/dist/style.css';

// Исходные данные
const initialNodes = [
  { id: '1', type: 'input', data: { label: 'Build' }, position: { x: 250, y: 0 }, status: 'Pending' },
  { id: '2', data: { label: 'Test' }, position: { x: 100, y: 150 }, status: 'Pending' },
  { id: '3', data: { label: 'Deploy' }, position: { x: 400, y: 150 }, status: 'Pending' },
];

const initialEdges = [
  { id: 'e1-2', source: '1', target: '2', animated: true },
  { id: 'e1-3', source: '1', target: '3', animated: true },
];

const statusColors = {
  Pending: '#f0ad4e',
  Running: '#5bc0de',
  Completed: '#5cb85c',
  Failed: '#d9534f',
};

const Pipeline = () => {
  const [nodes, setNodes, onNodesChange] = useNodesState(initialNodes);
  const [edges, setEdges, onEdgesChange] = useEdgesState(initialEdges);
  const [logs, setLogs] = useState([]);
  const [newTaskName, setNewTaskName] = useState('');

  // Обновление статуса задачи
  const updateNodeStatus = (nodeId, status) => {
    setNodes((nds) =>
      nds.map((node) => (node.id === nodeId ? { ...node, status, style: { background: statusColors[status], color: '#fff' } } : node))
    );
    setLogs((prevLogs) => [...prevLogs, `Task ${nodeId} status updated to ${status}`]);
  };

  // Имитация выполнения пайплайна
  const runPipeline = () => {
    updateNodeStatus('1', 'Running');
    setTimeout(() => {
      updateNodeStatus('1', 'Completed');
      updateNodeStatus('2', 'Running');
    }, 2000);

    setTimeout(() => {
      updateNodeStatus('2', 'Completed');
      updateNodeStatus('3', 'Running');
    }, 4000);

    setTimeout(() => {
      updateNodeStatus('3', 'Completed');
    }, 6000);
  };

  const addNode = (label) => {
    if (!label) return;
    const newNodeId = (nodes.length + 1).toString();
    const newNode = {
      id: newNodeId,
      data: { label },
      position: { x: Math.random() * 600, y: Math.random() * 400 },
      status: 'Pending',
      style: { background: statusColors['Pending'], color: '#fff' },
    };

    setNodes((nds) => [...nds, newNode]);
    setLogs((prevLogs) => [...prevLogs, `Added new task: ${label}`]);
    setNewTaskName('');
  };

  return (
    <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
      <h2>CI/CD Pipeline</h2>
      <button onClick={runPipeline} style={{ padding: '10px 20px', marginBottom: '20px', cursor: 'pointer' }}>
        Run Pipeline
      </button>
      <div style={{ marginBottom: '20px' }}>
        <input
          type="text"
          placeholder="Task Name"
          value={newTaskName}
          onChange={(e) => setNewTaskName(e.target.value)}
          style={{ padding: '5px', marginRight: '10px' }}
        />
        <button onClick={() => addNode(newTaskName)} style={{ padding: '5px 10px', cursor: 'pointer' }}>
          Add Task
        </button>
      </div>
      <div style={{ height: '400px', width: '800px', border: '1px solid #ddd' }}>
        <ReactFlow nodes={nodes} edges={edges} onNodesChange={onNodesChange} onEdgesChange={onEdgesChange} fitView>
          <MiniMap />
          <Controls />
          <Background color="#aaa" gap={16} />
        </ReactFlow>
      </div>
      <div style={{ marginTop: '20px', width: '800px', height: '150px', overflowY: 'auto', backgroundColor: '#f9f9f9', border: '1px solid #ddd', padding: '10px' }}>
        <h4>Logs</h4>
        {logs.map((log, index) => (
          <p key={index} style={{ margin: '5px 0' }}>
            {log}
          </p>
        ))}
      </div>
    </div>
  );
};

export default Pipeline;
